/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.welcome {
  display: flex;
  font-size: 1.25em;
  line-height: 1.4;
  color: #9fa5b1;
  background-color: #2e3138;
  overflow-x: auto;
}
.welcome p {
  line-height: inherit;
}
.welcome a {
  color: #6494ed;
}
.welcome ul {
  padding-left: 2em;
}
.welcome label {
  margin-top: 1em;
  font-weight: normal;
}
.welcome .input-checkbox {
  margin-top: -0.2em;
  margin-right: .5em;
}
.welcome-container {
  width: 100%;
  max-width: 580px;
  min-width: 300px;
  margin: auto;
  padding: 3em 2em;
}
.welcome-header {
  margin: 0 0 3em 0;
}
.welcome-logo {
  display: block;
  width: 100%;
  max-width: 280px;
  margin: 0 auto 2em auto;
  color: #d8dadf;
}
.welcome-title {
  font-size: 1.4em;
  text-align: center;
  line-height: 1.3;
  margin: 1em 0;
}
.welcome-card {
  margin: 1em 0;
  border-radius: 6px;
  border: 1px solid #1b1d22;
  background-color: #343841;
}
.welcome-summary {
  padding: 1em 1.5em;
  font-size: 1.1em;
  font-weight: 300;
  line-height: 1.4;
  cursor: pointer;
}
.welcome-summary:hover {
  color: #aaafbb;
}
.welcome-summary::-webkit-details-marker {
  display: none;
}
.welcome-summary:before {
  width: 20px;
  color: rgba(159, 165, 177, 0.6);
}
details[open] .welcome-summary:before {
  color: #d8dadf;
}
details[open] .welcome-summary {
  color: #d8dadf;
}
.welcome-highlight {
  color: #d8dadf;
}
.welcome-detail {
  border-top: 1px solid #1b1d22;
  padding: 1.5em;
}
.welcome-detail .welcome-note {
  margin-bottom: 0;
}
.welcome-detail .btn {
  margin-top: 3.33333333px;
  margin-bottom: 3.33333333px;
}
.welcome-img {
  display: block;
  max-width: 100%;
  border-radius: 3px;
  margin: 0 0 1em 0;
  border: 1px solid #1b1d22;
}
.welcome-consent {
  margin-top: 3em;
}
.welcome-consent-choices {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  margin: 1em -1em;
}
.welcome-consent-choices button {
  width: 100%;
}
.welcome-consent-choices div {
  margin: .5em 1em;
  flex: 1;
}
.welcome-consent-choices .welcome-note {
  margin-top: 1em;
}
.welcome-key {
  display: inline-block;
  padding: .3em .4em;
  font-size: .8em;
  line-height: 1;
  border-radius: 3px;
  color: #d8dadf;
  border: 1px solid rgba(159, 165, 177, 0.6);
  background: rgba(0, 0, 0, 0.1);
}
.welcome-love {
  color: rgba(159, 165, 177, 0.6);
}
.welcome-love a {
  color: rgba(159, 165, 177, 0.6);
}
.welcome-love .icon::before {
  position: relative;
  top: 4px;
  width: auto;
  margin-right: 0;
  font-size: 1.5em;
}
.welcome-love .icon-logo-github::before {
  top: 2px;
  font-size: 3.6em;
  vertical-align: top;
}
.welcome-note {
  font-size: .86em;
  color: rgba(159, 165, 177, 0.6);
}
.welcome-note .icon {
  margin-left: 5px;
}
.welcome-note .icon::before {
  margin-right: 0;
}
.welcome-footer {
  margin-top: 1em;
  text-align: center;
}
